	add("freakazoid", "{\"term\":\"freakazoid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027\u0027 + \u0027\u0027 + \u0027-oid\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A freaky person or creature; a freak\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Louis Theroux, \u0026quot;[http://books.google.com/books?id\u003ddInX4BRTlQ8C\u0026amp;pg\u003dPA15\u0026amp;dq\u003d%22freakazoid%22 Michael Jackson, Doo-Doo Head]\u0026quot;, \u0027Spy\u0027, July/August 1994\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But of the more serious allegation — being a total \u0027\u0027freakazoid\u0027\u0027 — Jacko seems guilty as charged\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Elizabeth Flock, \u0027Everything Must Go\u0027, MIRA (2006), ISBN 9780778323235, [http://books.google.com/books?id\u003d5jkY9k8i04UC\u0026amp;q\u003d%22freakazoid%22 page 22\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;I don\u0027t want a \u0027\u0027freakazoid\u0027\u0027 for a younger brother, that\u0027s why,\u0026quot; Brad said\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Jacquelyn Mitchard, \u0027The Midnight Twins\u0027, Razorbill (2008), ISBN 9781101158883, [http://books.google.com/books?id\u003d0stzpOwQBrYC\u0026amp;pg\u003dPT80\u0026amp;dq\u003d%22freakazoid%22 unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"“Do you promise to shut up if we find out he\u0027s a \u0027\u0027freakazoid\u0027\u0027 who likes to kill animals and set fires?” Mally shot back\", \"priority\":7}]}, \"synonyms\":{}}");

