	add("freedom", "{\"term\":\"freedom\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"northern frisian\", \"middle high german (ca. 1050-1500)\", \"low german\", \"Dutch\", \"Norwegian\"], \"text\":\"From Middle english (1100-1500) {{m|enm|freedom}}, {{m|enm|fredom}}, from Old english (ca. 450-1100) {{m|ang|frēodōm||freedom, state of free-will, charter, emancipation, deliverance}}, from Proto-germanic {{m|gem-pro|*frijadōmaz||freedom}}, equivalent to {{suffix|free|dom|lang\u003den}}. Cognate with Northern frisian {{m|frr|fridoem||freedom}}, Dutch {{m|nl|vrijdom||freedom}}, Low german {{m|nds|fridom|frīdom|freedom}}, Middle high german (ca. 1050-1500) {{m|gmh|vrītuom||freedom}}, Norwegian {{m|no|fridom||freedom}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being free, of not being imprisoned or enslaved\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The lack of a specific constraint, or of constraints in general; a state of being free, unconstrained\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d26|page\u003d18|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/2013/jun/02/hypocrisy-lies-at-heart-bradley-manning-trial Hypocrisy lies at heart of Manning passage\u003dThe dispatches [\u0026amp;hellip;] also exposed the blatant discrepancy between the west\u0027s professed values and actual foreign policies. Having lectured the Arab world about democracy for years, its collusion in suppressing \u0027\u0027freedom\u0027\u0027 was undeniable as protesters were met by weaponry and tear gas made in the west, employed by a military trained by westerners\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Frankness; openness; unreservedness\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I emboldened spake and \u0027\u0027freedom\u0027\u0027 used\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Improper familiarity; violation of the rules of decorum\", \"priority\":7}]}, \"synonyms\":{}}");

