	add("freephone", "{\"term\":\"freephone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|free|phone|lang\u003den}}, perhaps after the \u0027Freefone\u0027 (0800 number) service introduced in 1985 in the UK.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A service offering telephone calls free of charge to designated numbers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Peter Murley, \u0027Gower handbook of customer service‎\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If they are not marketed properly they can easily be viewed as a poor man\u0027s \u0027\u0027freephone\u0027\u0027. Therefore, if such a service is to succeed, it needs to be promoted\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Owen Hargie, Dennis Tourish, \u0027Handbook of communication audits for organisations‎\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One reason for the increase in public contact with companies has been the introduction of \u0027\u0027freephone\u0027\u0027, or toll-free, services\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Dave Patten, \u0027Successful marketing for the small business‎\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Adding a \u0027\u0027freephone\u0027\u0027 telephone number does increase response\", \"priority\":7}]}, \"synonyms\":{}}");

