	add("freesheet", "{\"term\":\"freesheet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|free|sheet|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A free newspaper\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0027Super-Cannes\u0027, Fourth Estate 2011, p. 108\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A helpful assistant suggested a local newspaper for English-speaking residents, but after a taxi ride to La Napoule I found only the back-street office of a \u0027\u0027free-sheet\u0027\u0027 listing properties for sale, swimming-pool constructors and dealers in used Mercedes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A sheet of paper that does not contain groundwood\", \"priority\":4}]}, \"synonyms\":{}}");

