	add("freeware", "{\"term\":\"freeware\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|free|ware|lang\u003den}}, a contraction of software; Coined by w:Andrew Fluegelman|Andrew Fluegelman\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Complete and functional software that does not require payment or other compensation (such as nags or advertising) for its use. Freeware may be a proprietary license with no access to the source code\", \"priority\":1}]}, \"synonyms\":{}}");

	add("freeway", "{\"term\":\"freeway\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A road designed for safe, high-speed operation of motor vehicles through the elimination of at-grade intersections, usually divided and having at least two lanes in each direction; a dual carriageway with no at-grade crossings, a motorway\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, David Brodsly, \u0027L. A. Freeway: An Appreciative Essay\u0027, %22freeways%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d6kdXT_nlDcj3mAXao-meDw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22freeways%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 1\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Contrary to what one might expect of an essay on \u0027\u0027freeways\u0027\u0027, this one is neither a diatribe nor a paean\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Derek Hayes, \u0027Canada: An Illustrated History\u0027, %22freeways%22+canada+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d7EZXT53WM8nUmAX3-IHTDw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"%22freeways%22%20canada%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 257\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In the late 1950s and 1960s most large cities started planning \u0027\u0027freeway\u0027\u0027 systems, acknowledging the incredible growth in car ownership\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Robert Freestone, \u0027Urban Nation: Australia′s Planning Heritage\u0027, %22freeways%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003doStXT9b6B4vjmAXyts2YDw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22freeways%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 161\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The Australian \u0027\u0027freeway\u0027\u0027 story of the late twentieth century, like many planning stories, can be told as one of high technical expectations dashed by political controversy\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A toll-free highway\", \"priority\":11}]}, \"synonyms\":{}}");

