	add("freight", "{\"term\":\"freight\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"middle low german\", \"old high german (ca. 750-1050)\"], \"text\":\"From Middle english (1100-1500) \u0027freyght\u0027 from Middle dutch (ca. 1050-1350) \u0027vracht\u0027 Middle low german \u0027vrecht\u0027 (cost of transport) ultimately from Proto-germanic {{m|gem-pro|*fra-|pos\u003dintensive prefix}} + Proto-germanic {{m|gem-pro|*aihtiz||possession}}, from Proto-indo-european {{m|ine-pro|*eiḱ-||to possess}}, equivalent to {{prefix|for|aught|lang\u003den}}. Cognate with Old high german (ca. 750-1050) {{m|goh|frēht||earnings}}, Old english (ca. 450-1100) \u0027ǣht\u0027 (sc\u003dlatinx) More at {{l|en|for-}}, {{l|en|own}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Payment for transportation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027freight\u0027\u0027 was more expensive for cars than for coal\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Goods or items in transport\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027freight\u0027\u0027 shifted and the trailer turned over on the highway\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Transport of goods\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"They shipped it ordinary \u0027\u0027freight\u0027\u0027 to spare the expense\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Cultural or emotional associations\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A wedding ring is small, but it has massive emotional \u0027\u0027freight\", \"priority\":8}]}, \"synonyms\":{}}");

