	add("french", "{\"term\":\"french\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"English\", \"middle english (1100-1500)\", \"Icelandic\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) {{m|enm|Frenche}}, {{m|enm|Frensch}}, {{m|enm|Frensc}}, {{m|enm|Frenkisch}}, {{m|enm|Franche}}, from Old english (ca. 450-1100) {{m|ang|frencisc||French|lit\u003dFrankish}}, equivalent to {{suffix|Frank|ish|lang\u003den}}. Cognate with Danish {{m|da|fransk||French}}, Swedish {{m|sv|fransk}}, {{m|sv|fransysk||French}}, Icelandic {{m|is|franska||French}}. Compare {{m|en|Frankish}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Romance language spoken primarily in France, Belgium, Switzerland, Quebec, Valle d\u0027Aosta and many former French colonies\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Albert Valdman, \u0027French and Creole in Louisiana\u0027, page 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Almost three quarters of the population 65 and older reported speaking \u0027\u0027French\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Jack Flam, \u0027Matisse and Picasso: The Story of Their Rivalry and Friendship\u0027, page 1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Although he would spend the rest of his life in France, Picasso never mastered the language, and during those early years he was especially self-conscious about how bad his \u0027\u0027French\u0027\u0027 was\", \"priority\":5}]}, \"synonyms\":{}}");

	add("frenchman", "{\"term\":\"frenchman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|French|man|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man of French birth or nationality\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A home-made tool used by bricklayers to cut excess mortar from newly pointed brickwork\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The red-legged partridge\", \"priority\":3}]}, \"synonyms\":{}}");

