	add("frenchy", "{\"term\":\"frenchy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A native or resident of France, or a francophone, or a person of French lineage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1903\u0027\u0027, Baroness Orczy, \u0027The Scarlet Pimpernel\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They seek him here, they seek him there\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Those \u0027\u0027Frenchies\u0027\u0027 seek him everywhere\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Is he in heaven—is he in hell\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"That damned elusive Pimpernel\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A short form for various names: Francine, Franchelle, Francoise, etc., e.g. w:Frenchie Franchelle \u0026quot;Frenchie\u0026quot; Davis\", \"priority\":7}]}, \"synonyms\":{}}");

