	add("frenzy", "{\"term\":\"frenzy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) \u0027frenesie\u0027 from Latin \u0027phrenesis\u0027 from Ancient greek (to 1453) {{m|grc|*φρένησις}}, a later equivalent of \u0027φρενῖτις\u0027 (inflammation of the brain) see \u0027frantic\u0027 and \u0027frenetic\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of wild activity or panic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"She went into a cleaning \u0027\u0027frenzy\u0027\u0027 to prepare for the unexpected guests\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A violent agitation of the mind approaching madness; rage\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Addiso\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"All else is towering \u0027\u0027frenzy\u0027\u0027 and distraction\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"William Shakespeare, \u0027A midsummer Night\u0027s Dream, Act 5, scene 1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The poet\u0027s eye in a fine \u0027\u0027frenzy\u0027\u0027 rolling\", \"priority\":7}]}, \"synonyms\":{}}");

	add("frequency", "{\"term\":\"frequency\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027frequentia\u0027 from \u0027frequens\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The rate of occurrence of anything; the relationship between incidence and time period\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"With growing confidence, the Viking’s raids increased in \u0027\u0027frequency\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027frequency\u0027\u0027 of bus service has been improved from 15 to 12 minutes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The property of occurring often rather than infrequently\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The FAQ addresses questions that come up with some \u0027\u0027frequency\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027frequency\u0027\u0027 of the visits was what annoyed him\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The quotient of the number of times \u0026lt;math\u0026gt;n\u0026lt;/math\u0026gt; a periodic phenomenon occurs over the time \u0026lt;math\u0026gt;t\u0026lt;/math\u0026gt; in which it occurs: \u0026lt;math\u0026gt;f \u003d n / t\u0026lt;/math\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027frequency\u0027\u0027 of the musical note A above middle C is 440 oscillations per second\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027frequency\u0027\u0027 of a wave is its velocity \u0026lt;math\u0026gt;v\u0026lt;/math\u0026gt; divided by its wavelength \u0026lt;math\u0026gt; lambda\u0026lt;/math\u0026gt;: \u0026lt;math\u0026gt;f \u003d v / lambda\u0026lt;/math\u0026gt\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Broadcasting live at a \u0027\u0027frequency\u0027\u0027 of 98.3 megahertz\u0026lt;!--fictional station--\u0026gt;, we’re your rock alternative\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027frequency\u0027\u0027 for electric power in the Americas is generally 60 Hz rather than 50\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"number of times an event occurred in an experiment (absolute frequency\", \"priority\":12}]}, \"synonyms\":{}}");

	add("freshet", "{\"term\":\"freshet\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027freschete\u0027 a diminutive of \u0027fres\u0027 (fresh) via its feminine form \u0027fresche\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flood resulting from heavy rain or a spring thaw\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1831\u0027\u0027, Log after log is hauled to the bank of the river, and in a short time their first raft is made on the shore and loaded with cordwood. When the next \u0027\u0027freshet\u0027\u0027 sets it afloat, it is secured by long grapevines or cables until, the proper time being arrived, the husband and sons embark on it and float down the mighty stream. — w:John James John James Audubon, \u0027s:Early Settlers Along the Early Settlers Along the Mississippi\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"You preserve water in times of flood and \u0027\u0027freshet\u0027\u0027 to be used for power or for irrigation throughout the year. …”\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A small stream, especially one flowing into the sea\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1936\u0027\u0027, Between the kerbs and the snow-banks a \u0027\u0027freshet\u0027\u0027 of clear blue water rises. Within me a \u0027\u0027freshet\u0027\u0027 that chokes the narrow gorge of my veins. — Henry Miller, \u0027Black Spring\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1959\u0027\u0027, We may find a dozen big catfish lying in the belly of the net, or a couple of walleyed pike, or some other kind of fresh-water fish. A \u0027\u0027freshet\u0027\u0027 brought them down, and they were making their way back up the river, and they hit the net.\u0026quot; — Joseph Mitchell, \u0027The Rivermen\", \"priority\":6}]}, \"synonyms\":{}}");

	add("freshness", "{\"term\":\"freshness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|fresh|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being fresh\", \"priority\":1}]}, \"synonyms\":{}}");

	add("freud", "{\"term\":\"freud\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003dde}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"of origin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"w:Sigmund Sigmund Freud, Austrian neurologist, psychotherapist, and founder of psychoanalysis\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"To assert that morality is self-evident and that one had\u0026lt;br\u0026gt; never done a mean thing are strangely revealing statements to\u0026lt;br\u0026gt; come from the lips of a person whose object of study was man,\u0026lt;br\u0026gt; himself included. It reflects, I believe, \u0026lt;b\u0026gt;Freud\u0026lt;/b\u0026gt;\u0027s unshakable\u0026lt;br\u0026gt; determination to be a moralist in the guise of a scientist.\u0026lt;sup\u0026gt;\u0026lt;small\u0026gt;10\u0026lt;/small\u0026gt;\u0026lt;/sup\u0026gt; In\u0026lt;br\u0026gt; this endeavor, he succeeded only too well: as a crypto-\u0026lt;br\u0026gt; moralist, \u0027\u0027Freud\u0027\u0027 became the founder of a sort of secular reli-\u0026lt;br\u0026gt; gion which has had immense influence on popular contempo-\u0026lt;br\u0026gt; rary thought and life\", \"priority\":3}]}, \"synonyms\":{}}");

	add("freudianism", "{\"term\":\"freudianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Freudian|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Freudian beliefs and practices, particularly the mechanism of psychological repression, the centrality of sexual desire to the development of the persona, and the efficacy of the \u0026quot;talking cure\u0026quot; or psychoanalytic technique\", \"priority\":1}]}, \"synonyms\":{}}");

	add("freya", "{\"term\":\"freya\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old norse\"], \"text\":\"Scottish form of Old norse \u0027freyja\u0027 (mistress, lady)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"of mostly British usage\", \"priority\":1}]}, \"synonyms\":{}}");

